  // - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - -
  // Update observers
  // - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - - -

  override func updateObservers (removedSet inRemovedSet : EBReferenceSet <PackagePad>,
                                 addedSet inAddedSet : EBReferenceSet <PackagePad>) {
    if self.mUsedForSignature {
      for managedObject in inRemovedSet.values {
        managedObject.setSignatureObserver (observer: nil)
        //  self.mResetOppositeRelationship? (managedObject) // Done in super method
      }
      for managedObject in inAddedSet.values {
        managedObject.setSignatureObserver (observer: self)
        //  self.mSetOppositeRelationship? (managedObject)  // Done in super method
      }
    }
  //---
    super.updateObservers (removedSet: inRemovedSet, addedSet: inAddedSet)
 }

